  `observaciones` varchar(225) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `asesor` varchar(25) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `prox_abono` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id_recibo`),
  KEY `id_usuario` (`id_usuario`),
  KEY `id_paciente` (`id_paciente`),
  CONSTRAINT `recibos_ibfk_1` FOREIGN KEY (`id_usuario`) REFERENCES `usuarios` (`id_usuario`),
  CONSTRAINT `recibos_ibfk_2` FOREIGN KEY (`id_paciente`) REFERENCES `pacientes` (`id_paciente`)
